import React from 'react';
import { Modal } from 'reactstrap';


class ModalTest extends React.Component {
   

    render() {
        const modal = this.state
    return (
        <div>
        <Modal modal={modal}>
        </Modal>
      </div>
        )
    }
}
export default ModalTest
